import React from "react";
import { Form } from "antd";
const FormItem = Form.Item;
function questionComponent(props) {
  const Showbutton = () => {
    return (
      <div className="nu-btn-showbtn">
        <div
          style={{
            width: "100%",
            flexBasis: "auto",
            justifyContent: "flex-end",
            display: "flex",
          }}
        >
          <Button
            className="nu-btn-question"
            onClick={() => {
              props.click(false, "...");
              setCheck(false);
            }}
          >
            ไม่ใช่
          </Button>
        </div>
        <div
          style={{
            width: "100%",
            flexBasis: "auto",
            justifyContent: "flex-start",
            display: "flex",
          }}
        >
          <Button
            className="nu-btn-question"
            type="primary"
            onClick={() => {
              props.click(true, "...");
              setCheck(false);
            }}
          >
            ใช่
          </Button>
        </div>
      </div>
    );
  };
  const Showquestion = () => {
    return (
      <div className="nu-flex-column-bsauto-w100 nu-center-covidss nu-h100-covidqt">
        <div className="nu-dp-name-covidqt">
          <div style={{ textAlign: "center" }}>
            <h1 style={{ color: "white", fontSize: "32px" }}>{props.text}</h1>
          </div>
        </div>
        <div className="nu-center-covidss nu-dp-btn-covidqt">
          <Showbutton/>
        </div>
      </div>
    );
  };
  return (
    <div style={{ textAlign: "center" }}>
      {props.check ? (
        <h1 style={{ color: "white" }}>Lording...</h1>
      ) : (
        //<h1 style={{ color: "white", fontSize: "32px" }}>{props.text}</h1>
        <Showquestion />
      )}
    </div>
  );
}

export default questionComponent;
